Cisco ICND1/CCENT(100-101)
In this exciting and important CBT Nugget course, CBT Nuggets trainers Anthony Sequeira and Keith Barker guide learners through the details and the strategies needed to ace the ICND1/CCENT exam 100-101 from Cisco Systems.

Cisco ICND2/CCNA(200-101)
In this exciting and important CBT Nugget course, trainers Anthony Sequeira and Keith Barker guide learners through the details and the strategies needed to ace Cisco's ICND2 exam 200-101.

The 200-101 Interconnecting Cisco Networking Devices Part 2 (ICND2) is the exam associated with the CCNA Routing and Switching certification. The exam tests a candidate's knowledge and skills required to successfully install, operate, and troubleshoot a small to medium-size enterprise branch network. The exam includes topics on LAN switching technologies, IP routing technologies, IP and WAN technologies.


